import React from 'react';

function Food({favourite})  {
  return <h1>I like {favourite}</h1>;
}

function App() {
  return (
  <div>
    <h1>
    Hello!! React!!
    <Food favourite="kimchi" />
    <Food favourite="ramen" /> 
    <Food favourite="samgiopsal" /> 
    <Food favourite="chukumi" /> 
    </h1>
  </div>
  )
}

export default App;
